import React from 'react';
import '../css/SplitFlashcard.css';

const SplitFlashcard = ({flashcard}) => {
    return (
        <div className="SplitFlashcard">
            <div className="SplitFlashcard-side-one">{flashcard.sideOneName}</div>

            <div className="SplitFlashcard-side-two">{flashcard.sideTwoName}</div>

        </div>
    )
}

export default SplitFlashcard
